import HomePage from "./HomePage"

export default function EmploeePage(props){
    return (
        <>
            <Link to="/" element = {<HomePage/>}>
                <div><h1>Emploee Page here {props.contact.name}</h1></div>

            </Link>


        </>

    )
}
